import React from 'react';
import Paper from '@material-ui/core/Paper';
import Button from '@material-ui/core/Button';

import TextField from '@material-ui/core/TextField';
const handleLogin = () => {
  console.log("hello")
}

onEmailChange = e => {
  this.setState({ email: e.target.value });
};
onPasswordChange = e => {
  this.setState({ password: e.target.value });
};

const LoginPage = () => {

  const styles = {
    loginContainer: {
      minWidth: 320,
      maxWidth: 400,
      height: 'auto',
      position: 'absolute',
      top: '20%',
      left: 0,
      right: 0,
      margin: 'auto'
    },
    paper: {
      padding: 20,
      overflow: 'auto'
    },
    btn: {
      background: '#4f81e9',
      color: 'white',
      padding: 7,
      borderRadius: 2,
      margin: 2,
      fontSize: 13
    },
  };



  return (
        <div style={styles.loginContainer}>

          <Paper style={styles.paper}>

            <form>
              <TextField
                placeholder="E-mail"
                fullWidth={true}
                onChange={onEmailChange}
              />
              <TextField
                placeholder="Password"
                fullWidth={true}
                type="password"
                onChange={onPasswordChange}
              />

              <div>
                <Button onClick={handleLogin} style={styles.btn} variant="contained" color="secondary">
                  Sign In
                </Button>
              </div>
            </form>
          </Paper>
        </div>
  );
};

export default LoginPage;
